import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    let data = [
      {
        nom: "Moussa",
        prenom: "Mahmoud",
        age: 31,
        months: "May"
      },

      {
        nom: "Mssa",
        prenom: "MooinaHamida",
        age: 33,
        months: "Août"
      },
      {
        nom: "Moussa",
        prenom: "Isaac",
        age: 2,
        months: "Octobre"
      }
    ];

    for (let i = 0; i < data.length; i++) {
      for (let j = 0; i < data.length; j++) {
        if (data[j].age > data[j + 1].age) {
          console.log("Hello");
        }
      }
    }
  });
  return <></>;
};

export default App;
